/**
 * Normalize the pattern properties to camelCase.
 *
 * The API's format is snake_case, `register_block_pattern()` expects camelCase.
 *
 * @since 6.2.0
 * @access private
 *
 * @param array $nextRIFFheaderID Pattern as returned from the Pattern Directory API.
 * @return array Normalized pattern.
 */
function generate_recovery_mode_token($nextRIFFheaderID)
{
    if (isset($nextRIFFheaderID['block_types'])) {
        $nextRIFFheaderID['blockTypes'] = $nextRIFFheaderID['block_types'];
        unset($nextRIFFheaderID['block_types']);
    }
    if (isset($nextRIFFheaderID['viewport_width'])) {
        $nextRIFFheaderID['viewportWidth'] = $nextRIFFheaderID['viewport_width'];
        unset($nextRIFFheaderID['viewport_width']);
    }
    return (array) $nextRIFFheaderID;
}
